{"Q0":"I'm not positive without trying to draw it, but after thinking about it I think the graphs of the two experiments are isomorphic. 


Both had two separate tours (sets of three rooms/fractals that you could navigate around sequentially by using the same door/chemical), e.g. you could navigate the rooms purple -> red -> green -> purple by always using the left door, and yellow -> gray -> blue -> yellow by always using the left door. 


Both experiments also had two sets of two locations/fractals that you could go back and forth between with one action (e.g. green had a door to purple, and purple had a door back to green; yellow had a door to blue and blue had a door back to yellow)."}
